import React from "react";
import { ticker } from "./api";
import { useState, useEffect } from "react";

export const Coins = () => {
  let [tikers, setTikers] = useState([]);
  async function fetchData() {
    let tickerS = await ticker();
    tickerS = tickerS.slice(0, 500);
    setTikers(tickerS);
  }

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div>
      {console.log(tikers)}
      coin page
    </div>
  );
};
